import pdfMake from "pdfmake/build/pdfmake"
import pdfFonts from "pdfmake/build/vfs_fonts"
import { dealWithToken } from './dealWithToken'
import { toConvert, currencyFormat, toTranslate, truncate } from './dateFormat'
import api from '../Services/api'

export const Report = async (code_list) => {
  const unity = localStorage.getItem('code_unity')
  const token = localStorage.getItem('token')
  pdfMake.vfs = pdfFonts.pdfMake.vfs


    const docDefinition = await api.get(`/one_list/${unity}/${code_list}`, dealWithToken(token)).then(response => { 
   
      var documents = response.data.documents.map(document => 
        [ 
          document.documents_SIAFI.map(siafi => [
            { text: `${siafi.year}${siafi.document}${siafi.number}`, alignment: 'center'}
          ]),
          {text: `${truncate(document.creditor.reason)}\n${document.creditor.code}`}, 
          {text: document.number, alignment: 'center'}, 
          {text: toConvert(document.emission), alignment: 'center'}, 
          currencyFormat(document.value) 
        ]
      )

      documents.unshift([
        {text: 'NE NS OB', alignment: 'center', fillColor: '#eeeeee',}, 
        {text: 'Credor', alignment: 'center', fillColor: '#eeeeee',}, 
        {text: 'Nº Doc', alignment: 'center', fillColor: '#eeeeee',}, 
        {text: 'Emissão', alignment: 'center', fillColor: '#eeeeee',}, 
        {text: 'Valor', alignment: 'center', fillColor: '#eeeeee',}
      ])

      return 	{    
        content: [
          {
            image: 'data:image/jpeg;base64, ',
            width: 100,
            alignment: 'center'
          },
          {
            text: 'MINISTÉRIO DA DEFESA\nEXÉRCITO BRASILEIRO\nBATALHÃO DE POLÍCIA DO EXÉRCITO DE BRASÍLIA\n(6ª Cia Gd/1957)\nBATALHÃO BRASÍLIA',
            style: 'header'
          },
          {
            text: [
              '\n\n\nREFERÊNCIA ',
              response.data.linked_to==="" 
              ? { text: 'DOCUMENTO NÃO INFORMADO', color: '#f04747' }
              : { text:  response.data.linked_to, bold: false },
            ],
            style: 'title'
          },
          {
            text: `\n${toTranslate(response.data.createdAt)}\n\n`,
            alignment: 'right',
            style: 'title'
          },
          {
            text: [
              '\nASSUNTO ', 
              { text: response.data.title.toUpperCase(), bold: false },
            ],
            style: 'title'
          },
          {
            text: [
              'DESCRIÇÃO ', 
              { text: response.data.description.toUpperCase(), bold: false },
              '\n\n'
            ],
            style: 'title'
          },
          {
            table: {
              headerRows: 1,
              widths: ['auto', '*', 'auto', 'auto', 'auto'],
      
              body: documents
            }
          },
          {
            text: [
              '\n\n', 
              { text: response.data.authentication.toUpperCase() },
              '\n',
              { text: response.data.occupation.toUpperCase() },
            ],
            style: 'title', 
            alignment:'center'
          }
        ],
        styles: {
          header: {
            fontSize: 12,
            bold: true,
            alignment: 'center'
          },
          title: {
            fontSize: 12,
            bold: true,
            alignment: 'left'
          },
          bigger: {
            fontSize: 15,
            italics: true
          }
        }
        
      }
    }).catch((err) => {
      console.log(err)
    })
  

  return await pdfMake.createPdf(docDefinition).download()

}